Storyline:

    Outlaw Brett Stanton and his gang, which includes his brother, Gar,ride into Carson City, Nevada, which is filled with people who have come there from all over to see the Heavyweight Championship prizefight between James J. &quot;Gentleman Jim&quot; Corbett and Bob Fitzsimmons. Broke and disgruntled, the gang asks Bret what he intends to do, and he tells them he is planning the biggest haul they have ever made. But gangs led by Johnny Ringo and Bob Thraikill are also in town with plans of their own, and no intention of abiding by Brett's plan.




